import React from 'react';

export const Card = ({ listOfTodos })=> {
  return (
    <>
      {listOfTodos.map(todo => {
        return(
          <ul key={todo.index}>
            <li>{todo.name}</li>
          </ul>
        )
      })}
      <ul>
        {listOfTodos.map(stocks => (<li>{stocks}</li>))}
      </ul>

    </>
  )
}
